"""# ROTACIÓN CON PIVOTE

$R_{pivot} = T^{-1}(-h, -k) * R(ang) * T(h, k)$
"""

#pueda rotar desde cualquier punto desde el espacio
#composicion de varias matrices
#1 llevar punto al origen
#Aplico rotacion en el origen
#La llevo al punto original

def rotacionPivote(h, k, ang):
    #se resta el centro 
    T1 = traslacion(-h, -k, 0)
    R = rotacion(ang)
    T2 = traslacion(h, k, 0)
    return np.matmul(np.matmul(T1, R), T2) 

