"""# Cambio de escala con punto fijo

$$ S_{fijo} = T^{-1}(-h, -k, 0)\cdot S(s_x, s_y, s_z) \cdot T(h, k, 0) $$

"""

def escalaFijo(h, k, s):
    T1 = traslacion(-h, -k, 0)
    S = escala(s,s,s)
    T2 = traslacion(h, k, 0)
    return np.matmul(np.matmul(T1, S), T2) 

