#CAMARA
#parametros direccion camara x0,y0,z0 nx,ny,nz,vx,vy,vz
def camara (x0,y0,z0,nx,ny,nz,vx,vy,vz):
  #1 traslacion al origen
  T1 = traslacion(-x0, -y0, -z0)
  #2 Alinear xw,yw,zw con xview
  #M = T^-1*R

  #dar punto y no direccion
  N = np.array([nx-x0,ny-y0,nz-z0])
  V = np.array([vx,vy,vz])
  N =  N/np.linalg.norm(N)
  V =  V/np.linalg.norm(V)
  #regla mano derecha
  U = np.cross(V,N)/1 #magnitud
  #print(type(U))
  #correccion de la vertical
  V = np.cross(N,U)
  #column mayor
  R = np.array([[U[0],U[1],U[2],0],[V[0],V[1],V[2],0],[N[0],N[1],N[2],0], [0,0,0,1]]).T

  M = np.matmul(T1,R)
  return M
  #OBJETO EN EL ORIGEN
  #MIRANDO AL ORIGEN N
